import React from 'react'
import { Link } from 'react-router-dom';

import './style.css'

function Nav() {
  return (
    <div className='body'>
        <Link to='/'>
        
        <span className='home'>Home</span></Link>
       <Link to='/logout'> <span className='logout'>Logout</span></Link>




    </div>
  )
}

export default Nav
